	function CreateNodeChart(nodes, links, payload) {
	    var width = 300,
	        height = 300,
	        colors = d3.scale.category10();

	    var svg = d3.select('#' + payload).append('svg').attr("preserveAspectRatio", "xMidYMid meet").attr("viewBox", "0 0 300 300");
	    // [
	    // {id: 'dadsada', reflexive: false},
	    // {id: 1, reflexive: false},
	    // {id: 2, reflexive: false},
	    // {id: 3, reflexive: false},
	    // {id: 4, reflexive: false},
	    // {id: 5, reflexive: false}
	    // ]

	    // [
	    // {source: nodes[0], target: nodes[1], left: false, right: true},
	    // {source: nodes[1], target: nodes[2], left: false, right: true}
	    // ]
	    var nodes = nodes,
	        links = links;

	    var force = d3.layout.force().nodes(nodes).links(links).size([width, height]).linkDistance(150).charge(-500).on('tick', tick);

	    svg.append('svg:defs').append('svg:marker').attr('id', 'end-arrow').attr('viewBox', '0 -5 10 10').attr('refX', 6).attr('markerWidth', 3).attr('markerHeight', 3).attr('orient', 'auto').append('svg:path').attr('d', 'M0,-5L10,0L0,5').attr('fill', '#000');
	    svg.append('svg:defs').append('svg:marker').attr('id', 'start-arrow').attr('viewBox', '0 -5 10 10').attr('refX', 4).attr('markerWidth', 3).attr('markerHeight', 3).attr('orient', 'auto').append('svg:path').attr('d', 'M10,-5L0,0L10,5').attr('fill', '#000');

	    var path = svg.append('svg:g').selectAll('path'),
	        circle = svg.append('svg:g').selectAll('g');
	    var selected_node = null,
	        selected_link = null,
	        mousedown_link = null,
	        mousedown_node = null,
	        mouseup_node = null;

	    function resetMouseVars() {
	        mousedown_node = null;
	        mouseup_node = null;
	        mousedown_link = null;
	    }

	    function tick() {
	        path.attr('d', function (d) {
	            var deltaX = d.target.x - d.source.x,
	                deltaY = d.target.y - d.source.y,
	                dist = Math.sqrt(deltaX * deltaX + deltaY * deltaY),
	                normX = deltaX / dist,
	                normY = deltaY / dist,
	                sourcePadding = d.left ? 17 : 12,
	                targetPadding = d.right ? 17 : 12,
	                sourceX = d.source.x + sourcePadding * normX,
	                sourceY = d.source.y + sourcePadding * normY,
	                targetX = d.target.x - targetPadding * normX,
	                targetY = d.target.y - targetPadding * normY;
	            return 'M' + sourceX + ',' + sourceY + 'L' + targetX + ',' + targetY;
	        });

	        circle.attr('transform', function (d) {
	            return 'translate(' + d.x + ',' + d.y + ')';
	        });
	    }

	    function restart() {
	        path = path.data(links);

	        path.classed('selected', function (d) {
	            return d === selected_link;
	        }).style('marker-start', function (d) {
	            return d.left ? 'url(#start-arrow)' : '';
	        }).style('marker-end', function (d) {
	            return d.right ? 'url(#end-arrow)' : '';
	        });

	        path.enter().append('svg:path').attr('class', 'link').classed('selected', function (d) {
	            return d === selected_link;
	        }).style('marker-start', function (d) {
	            return d.left ? 'url(#start-arrow)' : '';
	        }).style('marker-end', function (d) {
	            return d.right ? 'url(#end-arrow)' : '';
	        });
	        circle = circle.data(nodes, function (d) {
	            return d.id;
	        });
	        circle.selectAll('circle').style('fill', function (d) {
	            return d === selected_node ? d3.rgb(colors(d.id)).brighter().toString() : colors(d.id);
	        }).classed('reflexive', function (d) {
	            return d.reflexive;
	        });
	        var g = circle.enter().append('svg:g');

	        g.append('svg:circle').attr('class', 'node').attr('r', 12).style('fill', function (d) {
	            return d === selected_node ? d3.rgb(colors(d.id)).brighter().toString() : colors(d.id);
	        }).style('stroke', function (d) {
	            return d3.rgb(colors(d.id)).darker().toString();
	        }).classed('reflexive', function (d) {
	            return d.reflexive;
	        }).on('mouseover', function (d) {
	            if (!mousedown_node || d === mousedown_node) return;
	            // enlarge target node
	            d3.select(this).attr('transform', 'scale(1.1)');
	        });
	        // show node IDs
	        g.append('svg:text').attr('x', 0).attr('y', 4).attr('class', 'id').text(function (d) {
	            return d.id;
	        });
	        circle.exit().remove();
	        force.start();
	    }

	    restart();
	}

	function DecodeBase64(data) {
	    var _keyStr = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=";
	    return decode(data);

	    function decode(input) {
	        var output = "";
	        var chr1, chr2, chr3;
	        var enc1, enc2, enc3, enc4;
	        var i = 0;
	        input = input.replace(/[^A-Za-z0-9\+\/\=]/g, "");
	        while (i < input.length) {
	            enc1 = _keyStr.indexOf(input.charAt(i++));
	            enc2 = _keyStr.indexOf(input.charAt(i++));
	            enc3 = _keyStr.indexOf(input.charAt(i++));
	            enc4 = _keyStr.indexOf(input.charAt(i++));
	            chr1 = enc1 << 2 | enc2 >> 4;
	            chr2 = (enc2 & 15) << 4 | enc3 >> 2;
	            chr3 = (enc3 & 3) << 6 | enc4;
	            output = output + String.fromCharCode(chr1);
	            if (enc3 != 64) {
	                output = output + String.fromCharCode(chr2);
	            }
	            if (enc4 != 64) {
	                output = output + String.fromCharCode(chr3);
	            }
	        }
	        output = _utf8_decode(output);
	        return output;
	    }

	    function _utf8_decode(utftext) {
	        var string = "";
	        var i = 0;
	        var c = 0,
	            c1 = 0,
	            c2 = 0,
	            c3 = 0;
	        while (i < utftext.length) {
	            c = utftext.charCodeAt(i);
	            if (c < 128) {
	                string += String.fromCharCode(c);
	                i++;
	            } else if (c > 191 && c < 224) {
	                c2 = utftext.charCodeAt(i + 1);
	                string += String.fromCharCode((c & 31) << 6 | c2 & 63);
	                i += 2;
	            } else {
	                c2 = utftext.charCodeAt(i + 1);
	                c3 = utftext.charCodeAt(i + 2);
	                string += String.fromCharCode((c & 15) << 12 | (c2 & 63) << 6 | c3 & 63);
	                i += 3;
	            }
	        }
	        return string;
	    }
	}

	function EncodeBase64(form) {
	    // base64 인코딩 함수 (자바스크립트에서 인코딩 해서 넘김)
	    var InStr = form;
	    var ttb = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=";
	    var len_1 = InStr.length;
	    var len_res = InStr.length % 3;
	    var len_div = len_1 - len_res;
	    var ra = new makeArray(4);
	    var i = 0;
	    var Stat = "";
	    var str = "";
	    while (1) {
	        if (i >= len_1) break;

	        if (i >= len_div) Stat = "End";
	        var A = eval(InStr.charCodeAt(i++));
	        var B = eval(InStr.charCodeAt(i++));
	        var C = eval(InStr.charCodeAt(i++));
	        if (i > len_div) {
	            Stat = "End";
	            if (len_res >= 1) C = 0;
	            if (len_res == 1) B = 0;
	        }
	        ra[1] = A >> 2;
	        ra[2] = ((A & 3) << 4) + (B >> 4);
	        ra[3] = ((B & 15) << 2) + (C >> 6);
	        ra[4] = C & 63;
	        if (Stat == "End" && len_res >= 1) ra[4] = 64;
	        if (Stat == "End" && len_res == 1) ra[3] = 64;
	        for (var k = 1; k <= 4; k++) str = str + ttb.substr(ra[k], 1);
	    }

	    return str;
	}

	function makeArray(n) {
	    this.length = n;
	    for (var i = 1; i <= n; i++) {
	        this[i] = null;
	    }
	    return this;
	}

